tables.table_schema:
CREATE TABLE click_through_rates (
    user_id INT PRIMARY KEY,
    website_id INT,
    click_time TIMESTAMP,
    engagement_score FLOAT
);

CREATE TABLE click_data (
    user_id INT,
    timestamp TIMESTAMP,
    page_id INT,
    click_count INT
);

CREATE TABLE user_info (
    user_id INT,
    name VARCHAR(50),
    email VARCHAR(100),
    age INT
);

CREATE TABLE page_info (
    page_id INT,
    page_title VARCHAR(100),
    category VARCHAR(50),
    engagement_score FLOAT
);

CREATE TABLE page_metadata (
    page_id UUID PRIMARY KEY,
    page_url TEXT,
    category TEXT,
    created_date DATE
);

CREATE TABLE EngagementMetrics (
    user_id INT,
    page_id INT,
    clicks INT,
    duration_minutes INT
);
